import React from 'react'
import ITopic from '../../../../Models/ITopic';

interface IProps {
    topic: ITopic;
    position: number;
};

const colors: string[] = [
  "#97A5B8",
  "#9C95FD",
  "#F493FF",
  "#28E36E",
  "#FFE533",
];

const Topic: React.FC<IProps> = ({ topic, position }) => {
    return <p>{topic.name}</p>
}

export default Topic;
